import 'whatwg-fetch';

class HttpService {
    getExpenses = (id) => {
        var promise = new Promise((resolve, reject) => {
            var lmao = JSON.stringify({'eventId': id});
            console.log(lmao);
            fetch('http://localhost:3004/expense/all', {
            method: 'POST',
            body: lmao
            }).then(response => {
                resolve(response.json());
            })
        });
        return promise;
    }
}

export default HttpService;
